import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Navbar.css";

const Navigae = () => {
  const navigate = useNavigate();

  const handleCartClick = () => {
    const user_id = localStorage.getItem("user_id") || "null";
    if (user_id === "null") {
      navigate("/login");
    } else {
      navigate("/cart");
    }
  };

  return (
    <header className="navbar">
      <div className="navbar-top">
        <div className="logo">
          <h1>shopper.com</h1>
        </div>
        <div className="search-bar">
          <input type="text" placeholder="Search for products" />
        </div>
        <div className="navbar-links">
          <Link to="/download">Download App</Link>
          <Link to="/supplier">Become a Supplier</Link>
          <Link to="/newsroom">Newsroom</Link>
          <Link to="/profile">Profile</Link>
          <img
            src="https://cdn-icons-png.flaticon.com/128/4290/4290722.png"
            alt="Cart"
            className="cart-icon"
            onClick={handleCartClick}
          />
        </div>
      </div>
      <div className="navbar-bottom">
        <nav>
          <Link to="/women-ethnic">Women Ethnic</Link>
          <Link to="/women-western">Women Western</Link>
          <Link to="/men">Men</Link>
          <Link to="/kids">Kids</Link>
          <Link to="/home-kitchen">Home & Kitchen</Link>
          <Link to="/beauty-health">Beauty & Health</Link>
          <Link to="/jewellery-accessories">Jewellery & Accessories</Link>
          <Link to="/bags-footwear">Bags & Footwear</Link>
          <Link to="/electronics">Electronics</Link>
        </nav>
      </div>
    </header>
  );
};

export default Navbar;

